// router/index.js
import { createRouter, createWebHistory } from 'vue-router'
import ReasourceHome from '../views/ResourceHome.vue'
import AdminClassroom from '../views/Admin/AdminClassroom.vue'
import AdminApprove from '../views/Admin/AdminApprove.vue'
import AdminLibrary from '../views/Admin/AdminLibrary.vue'
import StudentLibrary from '../views/StudentLibrary.vue'
import TeaStuClassroom from '../views/TeaStuClassroom.vue'  // 这个导入现在会被使用

const routes = [
  {
    path: '/home',
    name: 'Home',
    redirect: '/resouce-home'  
  },
   {
    path: '/resouce-home',
    name: 'Home',
    component: ReasourceHome
  },
  {
    path: '/admin-classroom',
    name: 'AdminClassroom',
    component: AdminClassroom
  },
  {
    path: '/admin-approve',
    name: 'AdminApprove',
    component: AdminApprove
  },
  {
    path: '/admin-library',
    name: 'AdminLibrary',
    component: AdminLibrary
  },
  {
    path: '/student-library',
    name: 'StudentLibrary',
    component: StudentLibrary
  },
  {
    path: '/tea-stu-classroom',  // 添加这个路由
    name: 'TeaStuClassroom',
    component: TeaStuClassroom  // 现在这个导入被使用了
  }
]

const router = createRouter({
  history: createWebHistory(),
  routes
})

export default router
